import React from 'react';

const Services = () => {
    return (
        <section className='services'>
        <h2>Services</h2>
        <p>Our services include:</p>
        <ul>
            <li>Web Development</li>
            <li>Mobile Development</li>
            <li>SEO</li>
            <li>Design</li>
        </ul>
        </section>
    );
    };

export default Services;
